EasyWay mobile – current public transport routes in your mobile

Service is provided in:
 - Bulgaria (Sofia, Burgas, Pleven, Plovdiv, Varna);
 - Croatia (Zagreb);
 - Kazakhstan (Astana, Almaty);
 - Moldova (Chisinau, Tiraspol, Bender, Balti);
 - Russia (51 major city);
 - Serbia (Belgrade);
 - Ukraine (56 major cities);
 - Belorussia (Minsk);
 - Uzbekistan (Tashkent).

Realtime data is provided in the selected cities, partial coverage may apply:
 - Russia (Omsk, Samara, St.Petersburg, Krasnoyarsk, Perm, Novosibirsk, Kazan);
 - Ukraine (Kyiv, Kharkiv, Dnipro, Lviv, Mariupol, Kherson, Mykolaiv, Kryvyi Rih, Zhytomyr, Kropyvnytskyi, Sumy, Poltava, Oleksandria, Druzhkivka, Drohobych, Truskavets);
 - Moldova (Chisinau)
 - Bulgaria (Varna)

Features:
 - Offline-mode;
 - Optimal A to B route search;
 - Full list of current public transport routes, display-on-the-map possibility in the provided cities
 - Route scheme, schedule or interval, service time and travel cost;
 - GPS tracking of your movement;
 - Public Transport GPS-data for selected cities;
 - Real-time Stop schedule and Route direction;
 - Bookmarks, Cities and Routes Cache for traffic optimization;
 - Information on wheelchair accessible transport;
 - Multi-language interface.

O Centro de  Informação Geoespacial do Exército (CIGeoE) em parceria com a InfoPortugal S.A. disponibilizam as várias Séries Cartográficas produzidas no CIGeoE, de todo o território nacional, em dispositivos móveis , de forma simples e intuitiva, possibilitando uma navegação off road com o rigor, pormenor e detalhe próprio da Cartografia Militar, permitindo ao utilizador saber de onde vem, onde está e para onde vai, em qualquer local de Portugal.
A App "Cartas Militares" disponibiliza cartografia, do Centro de  Informação Geoespacial do Exército (CIGeoE) todo o Território Nacional (Continente, Madeira e Açores), de várias escalas:
·         1:500 000
·         1:250 000
·         1:50 000
·         1:25 000
Representação continua do terreno;
Navegação, com base em todos os elementos do terreno: relevo, hidrografia, vegetação, rede viária (principal, secundária e caminhos), construções e referências (naturais e artificiais);
Utilização offline de cartografia;
Série Cartográfica e Escala ajustadas automaticamente  em função do fator de zoom selecionado pelo utilizador;
Grau de detalhe ajustado automaticamente à área geográfica visível no ecrã do dispositivo;
Visualização da posição do utilizador sobre a cartografia, coordenadas geográficas, altitude, velocidade;
Pesquisas por toponímia e coordenadas;
Navegação por azimute e distância;
Leitura de KML (ficheiros Google Earth);
Gravação de percursos/rotas;
Navegação em percursos/rotas
Partilha de percursos e potas;
Definição/visualização/partilha de waypoints
Posição do utilizador centrada no dispositivo, automaticamente;
Rotação da cartografia de acordo com sentido de movimento.
